import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Header from '../Components/Header';
import NavigationBar from '../Components/NavigationBar';
import { Link } from 'react-router-dom'
import Footer from '../Components/Footer';
import './MarkEnter.css'

const EnterMarks = () => {
    return (
      <div>
        <Header/>
        <NavigationBar/>
        <h2>Enter Marks</h2>
        <Link to="/enter-marks/proposal"><button>Proposal</button></Link>
        <Link to="/enter-marks/progress1"><button>Progress 1</button></Link>
        <Link to="/enter-marks/progress2"><button>Progress 2</button></Link>
        <Link to="/enter-marks/final"><button>Final</button></Link>
        <Footer/>
      </div>
    );
  };
  
export default EnterMarks;
